import React from 'react';
import { styled } from 'styled-components';
const Header = () => {
  return (
    <Container>
      <Logo src="/images/logo.svg" alt="" />
    </Container>
  );
};

const Container = styled.div`
  max-width: 1230px;
  width: 100%;
  position: fixed;
  top: 0;
  left: 0;
  background-color: black;
  height: 80px;
`;

const Logo = styled.img``;

export default Header;
